import React, { Component } from 'react'

class Response extends Component {
    printEpisode = () => {
        console.log(this.props.episodes);
    }
    render() {
        return (
            <React.Fragment>
                { this.printEpisode() }
            </React.Fragment>
        );
    }
}

export default Response;
